import React, { Component, useContext } from "react";
import { PanelMenu } from "primereact/panelmenu";
import { useLocation, withRouter } from "react-router-dom";
import { Sidebar } from "primereact/sidebar";
import { OCUPATION_PAGE, LOGIN_PAGE } from "../../constants/routes";
import "./style.scss";

const SideBarMenu = ({ history }) => {
  const [visibleLeft, setVisibleLeft] = useState(false);
  const [visibleFullScreen, setVisibleFullScreen] = useState(false);
  const onSelect = (selected) => {
    history.push(selected);
  };
  const NUMERARIA_ITEMS = [
    {
      label: "Administrar Catálogos",
      icon: "pi pi-book",
      items: [
        {
          label: "Ocupaciones",
          icon: "pi pi-check",
          command: () => {
            onSelect(OCUPATION_PAGE);
          },
        },
        {
          label: "Pisos",
          icon: "pi pi-check",
        },
      ],
    },
    {
      label: "Administrar Residencia",
      icon: "pi pi-home",
      items: [
        {
          label: "Entrevistas",
          icon: "pi pi-check",
        },
        {
          label: "Residentes",
          icon: "pi pi-check",
        },
      ],
    },
    {
      label: "Cerrar Sesión",
      icon: "pi pi-fw pi-power-off",
    },
  ];
  return (
    <div>
      <div className="card">
        <Sidebar visible={visibleLeft} onHide={() => setVisibleLeft(false)}>
          <h3>Menú</h3>
          <PanelMenu model={NUMERARIA_ITEMS} style={{ width: "22rem" }} />
        </Sidebar>
      </div>
    </div>
  );
};
export default withRouter(SideBarMenu);
